import React from "react";
import "./FormField.css";

/**
 * FormField Component
 *
 * Props:
 *  - label: string
 *  - id: string
 *  - error?: string
 *  - children: input or custom field
 */
export default function FormField({ label, children, error, id }) {
  return (
    <div className="field">
      {label && (
        <label htmlFor={id} className="label">
          {label}
        </label>
      )}
      {children}
      {error && <div className="error">{error}</div>}
    </div>
  );
}
